// создание элемента != добавлению его на страницу
const a = document.createElement('a');
a.href='https://www.google.com';
a.innerText = 'Click me';
//добавление html
document.body.appendChild(a)  // append -добавление нескольких элементов    appendChild- добавление строго ОДНОГО элемента в самый конец элемента-родителя
const div = document.createElement('div');
div.innerText = 'Хайло!!!';
// Добавление перед тегом 'а'
document.body.insertBefore(div,a);
